import React from 'react';

class App extends React.Component {
  state = {
    randomNumber: null,
  };

  componentDidMount() {
    fetch('/api').then(res => {
      console.log(res)
    }).then(json => {
      console.log(json);
    })
  }

  render() {
    return (
      <div>
        Random Number: {this.state.randomNumber}
      </div>
    );
  }
}

export default App;
